    [JSInvokable]
    public async void ScrollDataLoad(string  _upload)
    {
        if(_upload=="true")
        {
            try
            {
                upload = true;
                pageindx++;
                var obj = await repositoryt.patient.GetAsync(pageindx, pagesize);

                var ilist = patients.ToList();
                ilist.AddRange(obj);
                patients = ilist.ToList();
